import React from 'react';
import {View, Text, TouchableOpacity, StyleSheet} from "react-native";

export default function Home({navigation}){
return (
    <View style={styles.container}>
        <Text>Bem Vindo!</Text>
        <View style={styles.areaBtn}>
          <TouchableOpacity
            style={[styles.botao, { backgroundColor: "#4F7063" }]}
            onPress={ () => navigation.navigate('Cadastrar Pet')}
          >
            <Text style={styles.botaoText}>Gerenciar Pets</Text>
          </TouchableOpacity>
        </View>

        <View style={styles.areaBtn}>
          <TouchableOpacity
            style={[styles.botao, { backgroundColor: "#4F7063" }]}
            onPress={ () => navigation.navigate('Cadastrar Pet')}
          >
            <Text style={styles.botaoText}>Gerenciar Protetores</Text>
          </TouchableOpacity>
        </View>

        <View style={styles.areaBtn}>
          <TouchableOpacity
            style={[styles.botao, { backgroundColor: "#4F7063" }]}
            onPress={ () => navigation.navigate('Cadastrar Pet')}
          >
            <Text style={styles.botaoText}>Gerenciar Doações</Text>
          </TouchableOpacity>
        </View>

    </View>
)
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
    },
    areaBtn: {
      alignItems: "center",
      flexDirection: "row",
      marginTop: 15,
      justifyContent: "space-around",
    },
    botao: {
      height: 50,
      justifyContent: "center",
      alignItems: "center",
      padding: 15,
      borderRadius: 5,
    },
    botaoText: {
      fontSize: 22,
      color: "#FFF",
    },
  });
